import { useEffect, useState } from 'react'
import './Products.css'
import { ItemCard } from '../ItemCard/ItemCard'

export const Products = ( { products} ) =>{

    return(
        <div className='Posts'>
            {products.map( (product) => (
                //console.log(product)
                <ItemCard 
                    key={product.id}
                    img={product.img}
                    title={product.title}
                    //description={post.description}
                    price={product.price}
                    rating={product.rating}   
                />
            ))}
        </div>
    )
}
